import React, { useState } from 'react';
import Packages from '../dashbord/Packages';
import Profile from '../dashbord/Profile';


function UserPanel() {
  const [currentPage, setCurrentPage] = useState('user');

  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  return (
    <div className='dashboard'>
         <div className="bg-gray-800 h-screen w-64 px-4 pt-4">
      <div className="text-white font-bold text-2xl mb-8">
        Dashboard
      </div>
      <ul>
          <li onClick={() => handlePageChange('user')}>User Panel</li>
          <li onClick={() => handlePageChange('settings')}>Settings Panel</li>
        </ul>
    </div>
      <div className='content w-1/4'>
        {currentPage === 'user' && <Packages />}
        {currentPage === 'settings' && <Profile />}
      </div>
    </div>
  );
}

export default UserPanel;
